function ExpenseDate(props) {
  const month = props.date.toLocaleString(navigator.language, {
    month: 'long',
  });
  const day = props.date.toLocaleString(navigator.language, {
    day: '2-digit',
  });
  const year = props.date.toLocaleString(navigator.language, {
    year: 'numeric',
  });
}
